function iconColourSelector(componentIdentifier, iconType) {
    let colour = "#A6A6A6";
    switch(componentIdentifier) {   
        case "eventPreviewTimer":   
        case "eventTimer":        
            if (iconType === "live") colour="#47A8FF";
            break;
    }
    return colour;
}

function iconDimensionSelector(componentIdentifier) {
    let iconDimensions = {};
    switch(componentIdentifier) {
        case "eventPreviewEvent":          
            iconDimensions.width = "23px";
            iconDimensions.height = "23px"; 
            break;
        case "eventPreviewTimer": 
            iconDimensions.width = "13px";
            iconDimensions.height = "13px";             
            break;  
        case "eventEvent":
            iconDimensions.width = "70px";
            iconDimensions.height = "70px";        
            break; 
        case "eventTimer":
            iconDimensions.width = "50px";
            iconDimensions.height = "50px";        
            break;       
        default:
            iconDimensions.width = "23px";
            iconDimensions.height = "23px";
            console.log("Icon dimensions were not matched");
            break;   
    }        
    return iconDimensions;
    
}

export default function Icon(props) {
    const iconDimensions = iconDimensionSelector(props.componentIdentifier);
    const iconColour = iconColourSelector(props.componentIdentifier, props.type);      
    const iconConfigObject = getSVGPathAndConfig(props.type);
    return (
    <svg
      width={iconDimensions.width}
      height={iconDimensions.height}
      xmlns="http://www.w3.org/2000/svg"
      viewBox={iconConfigObject.viewBox}
      xmlnsXlink="http://www.w3.org/1999/xlink"
      fill={iconColour}
    >
        <title>{iconConfigObject.title}</title>
        {iconConfigObject.path}
    </svg>
    )
 }